

import React from "react";
import { Grid, Box, Typography, Card, CardMedia } from "@mui/material";

const FeaturedEmployee= () => {
  const employers = [
    { logo: "https://www.shutterstock.com/image-vector/cng-letter-logo-design-illustration-260nw-2292198729.jpg", name: "Employer 1" },
    { logo: "data:image/png;base64,", name: "Employer 2" },
    { logo: "data:image/jpeg;base64,", name: "Employer 3" },
    { logo: "data:image/png;base64,", name: "Employer 4" },
    { logo: "data:image/png;base64,", name: "Employer 5" },
    { logo: "data:image/png;base64,", name: "Employer 6" },
  ];

  return (
    <Box sx={{ padding: "10px", backgroundColor: "#f9f9f9", textAlign: "center" }}>
      <Typography color="primary" variant="h5" fontWeight="bold" mb={3}>
        Featured Employers
      </Typography>
      <Grid container spacing={3} justifyContent="center">
        {employers.map((employer, index) => (
          <Grid item xs={6} sm={4} md={2} key={index}>
            <Card
              sx={{
                borderRadius: "8px",
                boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
                padding: "10px",
              }}
            >
              <CardMedia
                component="img"
                height="100"
                image={employer.logo}
                alt={employer.name}
                sx={{
                  objectFit: "contain",
                  margin: "auto",
                }}
              />
              
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default FeaturedEmployee;
